css:
@import "styles/languages/css";
.gutter-container {
  border: none;
}
.gutter-container .line-number {
  color: #6d8a88 !important;
  font-weight: 500;
}
.invisible-character,
.indent-guide {
  color: #6272a4;
  opacity: 0.25;
}
.editor {
  background: #282a36;
}
.selection .region {
  background: rgba(255, 255, 255, 0.1);
}
.cursor-line {
  background-color: rgba(255, 255, 255, 0.025);
}
.syntax--source {
  color: #f8f8f2;
}
.syntax--support {
  color: #50fa7b;
}
.syntax--comment {
  color: #6272a4;
}
.syntax--string,
.syntax--quoted,
.syntax--string-contents {
  color: #f1fa8c;
}
.syntax--keyword {
  color: #ff79c6;
}
.syntax--variable {
  color: #50fa7b;
}
.syntax--constant {
  color: #ffb86c;
}
.syntax--numeric {
  color: #bd93f9;
}
.syntax--operator {
  color: #ff79c6;
}
.syntax--tag {
  color: #ff79c6;
}
.syntax--attribute {
  color: #50fa7b;
}
.syntax--builtin {
  color: #50fa7b;
}
.syntax--property {
  color: #66d9ef;
}
.syntax--meta:not(.syntax--string-contents):not(.syntax--html) {
  color: #f8f8f2;
}
.syntax--function {
  color: #50fa7b;
}
.syntax--storage {
  color: #ff79c6;
}
.syntax--punctuation:not(.syntax--comment):not(.syntax--variable):not(.syntax--definition) {
  color: #f8f8f2;
}
.syntax--language.syntax--variable {
  color: #ff79c6;
}
.syntax--language.syntax--constant {
  color: #bd93f9;
}
.syntax--parameter {
  color: #ffb86c;
}
.syntax--attribute-name {
  color: #50fa7b;
}
.syntax--source.syntax--go .syntax--keyword {
  color: #ff79c6;
}
.syntax--source.syntax--html .syntax--meta.syntax--toc-list.syntax--id {
  color: #f1fa8c !important;
}
.syntax--source.syntax--html .syntax--doctype {
  color: #f8f8f2 !important;
}
.syntax--source.syntax--js .syntax--storage {
  color: #ff79c6;
}
.syntax--source.syntax--js .syntax--function.syntax--arrow {
  color: #ff79c6 !important;
}
.syntax--source.syntax--js .syntax--other {
  color: #50fa7b;
}
.syntax--source.syntax--js .syntax--method-call .syntax--function {
  color: #66d9ef;
}
.syntax--source.syntax--js .syntax--object {
  color: #50fa7b;
}
.syntax--source.syntax--js .syntax--property {
  color: #66d9ef;
}
.syntax--source.syntax--js .syntax--delimiter,
.syntax--source.syntax--js .syntax--punctuation:not(.syntax--embedded):not(.syntax--comment) {
  color: #f8f8f2 !important;
}
.syntax--source.syntax--js .syntax--punctuation.syntax--embedded {
  color: #f1fa8c;
}
.syntax--source.syntax--json .syntax--dictionary > .syntax--string,
.syntax--source.syntax--json .syntax--dictionary > .syntax--string > .syntax--string {
  color: #66d9ef;
}
.syntax--source.syntax--json .syntax--dictionary.syntax--separator + .syntax--string,
.syntax--source.syntax--json .syntax--dictionary.syntax--separator + .syntax--string > .syntax--string {
  color: #f1fa8c !important;
}
.syntax--source.syntax--gfm .syntax--heading {
  color: #50fa7b;
}
.syntax--source.syntax--gfm .syntax--entity {
  color: #66d9ef;
}
.syntax--source.syntax--gfm .syntax--link {
  color: #6272a4;
}
.syntax--source.syntax--gfm .syntax--raw {
  color: #f1fa8c;
}
.syntax--source.syntax--gfm .syntax--support {
  color: #f1fa8c;
}
.syntax--source.syntax--yaml .syntax--tag {
  color: #66d9ef;
}
.syntax--source.syntax--yaml .syntax--string.syntax--quoted,
.syntax--source.syntax--yaml .syntax--string > .syntax--string {
  color: #66d9ef;
}
.syntax--source.syntax--yaml .syntax--string.syntax--unquoted {
  color: #f8f8f2;
}
.syntax--source.syntax--yaml .syntax--separator + .syntax--string:not(.syntax--unquoted),
.syntax--source.syntax--yaml .syntax--separator + .syntax--string > .syntax--string:not(.syntax--unquoted) {
  color: #f1fa8c;
}
.syntax--source.syntax--yaml .syntax--constant.syntax--language {
  color: #bd93f9;
}
